import ChatBox from './components/ChatBox_number';
import './App.css';

const App = () => {
  return (
    <div className="app">
      <header className="app-header">
        <h1> give me a good name Chatbot</h1>
      </header>
      <main className="app-main">
        <ChatBox />
      </main>
    </div>
  );
};

export default App;
